import TopSeller from '../components/topSellers/TopSellers';
function HomePage() { 
    return (   
        <div style={{position: 'relative'}}>
            <Header />
            <Mainmenu/>
            <Slider/>
            <Promo/>
            <MainContent/>
            <TopSeller/>
            {/* <Oppo /> */}
            <Footer />
        </div>
    );
}

export default HomePage;
